    //           <ArtCard className={classes.item} image={ img.src }/>
    //         </GridListTile>
    //       );
    // }.bind(this));
    var array = images.forEach(function( img ) { require(img.src+"") });
    console.log(array.length);
    return (
      <DashboardLayout title="genlouise.art" >
          {/* <GridList cellHeight='auto' className={classes.gridList} cols={3}>
            {cards}
          </GridList> */}
          <Gallery photos={array}/>
          {/* {[{"src":require("./components/Art/Favicon.jpg"),"width":2,"height":2}]} */}
      </DashboardLayout>


    );
  }
}

Dashboard.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(styles)(Dashboard);
